import "inde"
export function AuthPages ({children}) {
return (
    <div className="login">
       <div className="login-logo">
          <img
             src="https://agilitymonitoramento.com.br/static/media/logo-pj-center.effeb7ae.svg"
             alt="MdLockLogin App"
          />
       </div>
       {children}
    </div>
  )  
}
